import React, { useState, useEffect, useRef, lazy, Suspense } from 'react';
import { BrowserRouter, Route, Routes, useLocation, useNavigate } from 'react-router-dom';
import FetchProducts from './components/FetchProducts';
import ScrollToTop from './components/ScrollToTop';

const NavBar = lazy(() => import('./components/NavBar'))
const Home = lazy(() => import('./components/Home/Home'))
const Shop = lazy(() => import('./components/Shop/Shop'))
const Product = lazy(() => import('./components/Product/Product'))
const Footer = lazy(() => import('./components/Footer'))

const App = () => {
  const [windowWidth, setWindowWidth] = useState(window.innerWidth);
  // Initialize shoppingCart state with data from localStorage or an empty array
  const [shoppingCart, setShoppingCart] = useState(() => {
    const cartFromLocalStorage = localStorage.getItem('shoppingCart');
    return cartFromLocalStorage ? JSON.parse(cartFromLocalStorage) : [];
  });
  const { allProducts }: any = FetchProducts();
  const categories = ['women', 'men', 'jewelery', 'best-sellers', 'all-products']
  const products = [

{id: 1, title: 'Fjallraven - Foldsack No. 1 Backpack, Fits 15 Laptops', price: 109.95, description: 'Your perfect pack for everyday use and walks in th…to 15 inches) in the padded sleeve, your everyday', category: "men's clothing", rating
: 
{rate: 3.9, count: 120},
image
: 
"https://fakestoreapi.com/img/81fPKd-2AYL._AC_SL1500_.jpg"},

{id: 2, title: 'Mens Casual Premium Slim Fit T-Shirts ', price: 22.3, description: 'Slim-fitting style, contrast raglan long sleeve, t…e round neckline includes a three-button placket.', category: "men's clothing", rating
: 
{rate: 4.1, count: 259},
image
: 
"https://fakestoreapi.com/img/71-3HjGNDUL._AC_SY879._SX._UX._SY._UY_.jpg"}

  ]

  // Save shoppingCart to local storage whenever it changes
  useEffect(() => {
    localStorage.setItem('shoppingCart', JSON.stringify([shoppingCart]));
    console.log(shoppingCart)
  }, [shoppingCart]);

  const RedirectToHome = (): any => {
    const navigate = useNavigate();
    React.useEffect(() => {
      navigate('/');
    }, [navigate]);
  }

  useEffect(() => {
    const handleWindowResize = () => {
      setWindowWidth(window.innerWidth);
    };

    window.addEventListener('resize', handleWindowResize);

    return () => {
      window.removeEventListener('resize', handleWindowResize);
    };
  });

  useEffect(() => {
    console.log(allProducts)
  }, [allProducts])

  return (
    <BrowserRouter>
      <Suspense fallback={<div className='suspenseLoaderWrapper'><span className="mainLoader"></span></div>}>
        <NavBar windowWidth={windowWidth} allProducts={allProducts} />
        <ScrollToTop />
        <Routes>
          <Route path='/' element={<Home windowWidth={windowWidth} allProducts={allProducts} />} />
          {categories.map((category, index) => (
            <Route key={index} path={`/shop/${category}`}
              element={<Shop windowWidth={windowWidth} allProducts={allProducts} />}
            />
          ))}
          {products.map((product: any, index: number) => (
            <Route key={index} path={`/product/${product.id}`}
              element={<Product windowWidth={windowWidth} allProducts={allProducts} product={product} setShoppingCart={setShoppingCart} 
              shoppingCart={shoppingCart}/>}
            />
          ))}
          <Route path='/shop/search' element={<Shop windowWidth={windowWidth} allProducts={allProducts} />} />
          <Route path='*' element={<RedirectToHome />} />
        </Routes>
        <Footer />
      </Suspense>
    </BrowserRouter>
  );
}

export default App;
